import React from "react";
import styled from "styled-components";
import {Link} from "react-router-dom";
import Img from '../../homepage.png';

class HomePage extends React.Component{
    render() {
        return (
            <div> 
                               
                <div>
                    <h1>Welcome to Coin A-Z</h1>
                    <h1>An easy way to track and manage crypto assets.</h1>
                        Welcome to Coin A-Z. Our plan is to make it easy for our users to track and research different crypto assets. We allow our users to create their own custom po
                        
                </div>
                <p></p>
                <div>
                   
                        <img src={Img} />
                    
                </div>
                <p></p>
                <div>
                    <p className="font15 whiteColor">
                        <em>Track your crypto assets with our portfolio tracker</em>
                    </p>
                    <p className="font13 orangeColor textRight" style={{marginTop: '10px'}}><em>Click here to get started </em><Link to="/portfolio">Portfolio Tracker</Link></p>
                    
                </div>
             
            </div>
        );
    }
}

const BtnWrapper = styled.div`
  max-width: 190px;
  @media (max-width: 960px) {
    margin: 0 auto;
  }
`;

export default HomePage;
